import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import Image from 'react-bootstrap/Image';

function Slides() {
  return (
    <Carousel>
      <Carousel.Item>
        {/* Use Image component with the source of your first image */}
        <Image src="../assets/image1.png" alt="First slide" fluid />
        <Carousel.Caption>
          <h3>First slide label</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        {/* Use Image component with the source of your second image */}
        <Image src="../assets/image3.png" alt="Second slide" fluid />
        <Carousel.Caption>
          <h3>Second slide label</h3>
        </Carousel.Caption>
      </Carousel.Item>

    </Carousel>
  );
}

export default Slides;
